_advantage','field_5eb2ac462e22a'),(462,11,'mp_ab_title','О компании'),(463,11,'_mp_ab_title','field_5eb3ffafb3701'),(464,11,'mp_ab_desc','Кожгалантерейная фабрика Oscar специализируется на производстве кожанных поясных ремней. За долное время \r\nсвоего существования, добилась лидерства в выборе покупателей. Наши покупатели предпочитают продукцию фабрики Oscar \r\nпо уровню высокого качества, лучшей ценой, среди конкурентов, широчайшем ассортименте товаров,\r\nа также в постоянном  наличии товаров на складе. Ассортимент включает в себя: ремни мужские, женские, детские \r\nв различных ценовых сигментах, цельнокроенные и составные(дутые), произведенные из отечественных и импортных кож,\r\nвысокого качества. Уже запущено и упорно развивается новое направление по производству кожгалантереи ( мужские и \r\nженские сумки, рюкзаки, кошельки, клатки, и мелкая кожгалантерея. Мы будем рада сотрудничать с каждым клиентом.\r\nВыбирая продукцию нашей фабрики - вы создаете своё будущее! '),(465,11,'_mp_ab_desc','field_5eb3ffe9b3702'),(466,105,'main_h1','Ремни и кожгалантерея от производителя оптом'),(467,105,'_main_h1','field_5eb28742f28a0'),(468,105,'контент_под_заголовком','Сумки для мужчин и женщин от производителя'),(469,105,'_контент_под_заголовком','field_5eb287b8f28a1'),(470,105,'header_carousel_0_carousel_image','87'),(471,105,'_header_carousel_0_carousel_image','field_5eb28d373e9da'),(472,105,'header_carousel_1_carousel_image','88'),(473,105,'_header_carousel_1_carousel_image','field_5eb28d373e9da'),(474,105,'header_carousel_2_carousel_image','89'),(475,105,'_header_carousel_2_carousel_image','field_5eb28d373e9da'),(476,105,'header_carousel','3'),(477,105,'_header_carousel','field_5eb288213e9d9'),(478,105,'mp_h1_desc','Сумки для мужчин и женщин от производителя'),(479,105,'_mp_h1_desc','field_5eb287b8f28a1'),(480,105,'the_advantage_0_icon','100'),(481,105,'_the_advantage_0_icon','field_5eb2ac752e22b'),(482,105,'the_advantage_0_title','Доставка'),(483,105,'_the_advantage