имент включает в себя: ремни мужские, женские, детские \r\nв различных ценовых сигментах, цельнокроенные и составные(дутые), произведенные из отечественных и импортных кож,\r\nвысокого качества. Уже запущено и упорно развивается новое направление по производству кожгалантереи ( мужские и \r\nженские сумки, рюкзаки, кошельки, клатки, и мелкая кожгалантерея. Мы будем рада сотрудничать с каждым клиентом.\r\nВыбирая продукцию нашей фабрики - вы создаете своё будущее! '),(557,108,'_mp_ab_desc','field_5eb3ffe9b3702'),(558,108,'mp_ab_bg','107'),(559,108,'_mp_ab_bg','field_5eb400ebd0e9f'),(560,116,'_wp_attached_file','2020/05/red_girl-3.jpg'),(561,116,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:561;s:6:\"height\";i:766;s:4:\"file\";s:22:\"2020/05/red_girl-3.jpg\";s:5:\"sizes\";a:6:{s:6:\"medium\";a:4:{s:4:\"file\";s:22:\"red_girl-3-220x300.jpg\";s:5:\"width\";i:220;s:6:\"height\";i:300;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:9:\"thumbnail\";a:4:{s:4:\"file\";s:22:\"red_girl-3-150x150.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:21:\"woocommerce_thumbnail\";a:5:{s:4:\"file\";s:22:\"red_girl-3-300x300.jpg\";s:5:\"width\";i:300;s:6:\"height\";i:300;s:9:\"mime-type\";s:10:\"image/jpeg\";s:9:\"uncropped\";b:0;}s:29:\"woocommerce_gallery_thumbnail\";a:4:{s:4:\"file\";s:22:\"red_girl-3-100x100.jpg\";s:5:\"width\";i:100;s:6:\"height\";i:100;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:12:\"shop_catalog\";a:4:{s:4:\"file\";s:22:\"red_girl-3-300x300.jpg\";s:5:\"width\";i:300;s:6:\"height\";i:300;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:14:\"shop_thumbnail\";a:4:{s:4:\"file\";s:22:\"red_girl-3-100x100.jpg\";s:5:\"width\";i:100;s:6:\"height\";i:100;s:9:\"mime-type\";s:10:\"image/jpeg\";}}s:10:\"image_meta\";a:12:{s:8:\"aperture\";s:1:\"0\";s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";s:1:\"0\";s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";s:1:\"0\";s:3:\"iso\";s:1:\"0\";s:13:\"shutter_