отрудничество'),(813,135,'_mp_pr_title','field_5eb40c3d67d88'),(814,135,'mp_pr_desc','<!--(figmeta)eyJmaWxlS2V5IjoiZHhSOWNkM1NabG5OM0VNS09UYk5mZCIsInBhc3RlSUQiOjIwMzk1ODQzMiwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)--><!--(figma)(/figma)-->Компания Rembay уже более 25 лет успешно работает с оптовыми клиентами из разных городов России и стран СНГ.\r\n\r\nМинимальный объем единовременной закупки:\r\nот 5 000 рублей с учетом всех скидок!'),(815,135,'_mp_pr_desc','field_5eb40c9267d89'),(816,135,'mp_pr_bottom_img','116'),(817,135,'_mp_pr_bottom_img','field_5eb41afd6ce86'),(818,135,'mp_pr_top_img','117'),(819,135,'_mp_pr_top_img','field_5eb420dbc0162'),(820,135,'mp_pr_button_title','Новая коллекция'),(821,135,'_mp_pr_button_title','field_5eb41b5c6ce87'),(822,135,'mp_pr_button_url','#'),(823,135,'_mp_pr_button_url','field_5eb41f1f6ce88'),(824,135,'ct_mp_title','Контакты'),(825,135,'_ct_mp_title','field_5eb45586dfe73'),(826,139,'_form','[email* your-email placeholder \"E-mail\"]\n[submit class:button \"Подписаться\"]'),(827,139,'_mail','a:9:{s:6:\"active\";b:1;s:7:\"subject\";s:22:\"Remby \"[your-subject]\"\";s:6:\"sender\";s:27:\"Remby <wordpress@remby.loc>\";s:9:\"recipient\";s:14:\"admin@admin.ru\";s:4:\"body\";s:184:\"От: [your-name] <[your-email]>\nТема: [your-subject]\n\nСообщение:\n[your-message]\n\n-- \nЭто сообщение отправлено с сайта Remby (http://remby.loc)\";s:18:\"additional_headers\";s:22:\"Reply-To: [your-email]\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";b:0;s:13:\"exclude_blank\";b:0;}'),(828,139,'_mail_2','a:9:{s:6:\"active\";b:0;s:7:\"subject\";s:22:\"Remby \"[your-subject]\"\";s:6:\"sender\";s:27:\"Remby <wordpress@remby.loc>\";s:9:\"recipient\";s:12:\"[your-email]\";s:4:\"body\";s:125:\"Сообщение:\n[your-message]\n\n-- \nЭто сообщение отправлено с сайта Remby (http://remby.loc)\";s:18:\"additional_headers\";s:24:\"Reply-To: admin@admin.ru\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";b:0;s:13:\"exclude_blank\";b:0;}'),(829,139,'_messages','a:22:{s