0-05-04 16:21:24','2020-05-04 13:21:24','<!--(figmeta)eyJmaWxlS2V5IjoiZHhSOWNkM1NabG5OM0VNS09UYk5mZCIsInBhc3RlSUQiOjYwMTEzNDkwMSwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)--><!--(figma)(/figma)-->Кожгалантерейная фабрика Oscar специализируется на производстве кожанных поясных ремней.\r\n\r\nЗа долное время своего существования, добилась лидерства в выборе покупателей. Наши покупатели предпочитают продукцию фабрики Oscar по уровню высокого качества, лучшей ценой, среди конкурентов, широчайшем ассортименте товаров, а также в постоянном наличии товаров на складе.\r\n\r\nАссортимент включает в себя: ремни мужские, женские, детские в различных ценовых сигментах, цельнокроенные и составные(дутые), произведенные из отечественных и импортных кож, высокого качества. Уже запущено и упорно развивается новое направление по производству кожгалантереи ( мужские и женские сумки, рюкзаки, кошельки, клатки, и мелкая кожгалантерея.\r\n\r\nМы будем рада сотрудничать с каждым клиентом. Выбирая продукцию нашей фабрики - вы создаете своё будущее!','О компании','','publish','closed','closed','','about','','','2020-05-08 23:47:01','2020-05-08 20:47:01','',0,'http://remby.loc/?page_id=27',0,'page','',0),(28,1,'2020-05-04 16:20:52','2020-05-04 13:20:52','','О компании','','inherit','closed','closed','','27-revision-v1','','','2020-05-04 16:20:52','2020-05-04 13:20:52','',27,'http://remby.loc/2020/05/04/27-revision-v1/',0,'revision','',0),(29,1,'2020-05-04 16:22:15','2020-05-04 13:22:15','Наша фабрика клиентоариентирована и прислушивается ко всем пожеланиям наших клиентов, мы рады сотрудничать с каждым клиентом, будь то мелкий опт, крупный опт, или индивидуальное производство.\r\n\r\nПо вашим желаниям и образцам мы произведем, то что вам нужно и в любом колличестве, в кратчайшие сроки. Цены формируются соответсвенно объема заказа, для каждого клиента.\r\n\r\nЗвоните и пишете нам, и мы ответим на все ваши интересующие вопросы.\r\n\r\nРазмер скидки, в зависимости от суммы прихода денежных средств за календарный месяц:\r\n\r\n<img class=\"alignnone size-full wp-image-161\" src=\"http://remby.loc/wp-content/uploads/2020/05/Screenshot_3.png\" alt=\"\" width=\"564\" height=\"238\" />\r\n<h2><strong>*Условия предоставления скидки:</strong></h2>\r\n<ul>\r\n 	<li>Скидка рассчитывается на основе реальной суммы закупки / суммы прихода денежных средств, за один календарный месяц.</li>\r\n 	<li>Скидка является накопительной в рамках одного календарного месяца и закрепляется на клиенте в течение 2-х календарных месяцев (1-й месяц – месяц в котором осуществлено накопление объёмной скидки; 2-й месяц – месяц, следующий за месяцем накопления объёмной скидки).</li>\r\n 	<li>В случае возникновения на клиенте просроченной дебиторской задолженности сроком более 10 рабочих дней, накопленная объёмная скидка аннулируется.</li>\r\n 	<li>На товар из раздела \"Распродажа\" накопительные скидки не действуют</li>\r\n</ul>','Условия  сотрудничества','','publish','closed','closed','','usloviya','','','2020-05-09 00:01:32','2020-05-08 21:01:32','',0,'http://remby.loc/?page_id=29',0,'page','',0),(30,1,'2020-05-04 16:22:15','2020-05-04 13:22:15','','Условия  сотрудничества','','inherit','closed','closed','','29-revision-v1','','','2020-05-04 16:22:15','2020-05-04 13:22:15','',29,'http://remby.loc/2020/05/04/29-revision-v1/',0,'revision','',0),(31,1,'2020-05-04 16:23:13','2020-05-04 13:23:13','Наш интернет-магазин предлагает несколько вариантов <span style=\"color: #e64547;\">ДОСТАВКИ</span>:\r\n<ul>\r\n 	<li>Бесплатная доставка в транспортные компании, основных перевозчиков, находящихся в Москве: Автотрейдинг, Желдорэкспедиция, Байкал-Сервис, ПЭК, Деловые Линии , Лоуд Сервис;</li>\r\n 	<li>Бесплатная доставка к автобусным стоянкам, расположенным в ТК Москва(Люблино), ТК Садовод, ТК Южные Ворота</li>\r\n</ul>\r\n<h2>Доставка и оплата: Бесплатная доставка в транспортные компании, основных перевозчиков, находящихся в Москве: Автотрейдинг, Желдорэкспедиция, Байкал-Сервис, ПЭК, Деловые Линии , Лоуд Сервис</h2>\r\nВы можете заказать доставку товара с помощью курьера, который прибудет по указанному адресу в согласованное удобное для Вас время и день с 09.00 до 23.00. Непосредственно перед доставкой курьер связывается с Вами за 15-20 минут и сообщит, что направляется к Вам.\r\n\r\nПри получении товара Вы осматриваете товар на целостность и отсутствие заводского брака. После Вы оплачиваете покупку курьеру.\r\n\r\nДоставка курьером по г. Минск бесплатная - доставляем в день заказа либо на следующий.\r\nПо РБ 10 BYN - срок доставки 1-2 дня в зависимости от региона.\r\n<h2>Бесплатная доставка к автобусным стоянкам, расположенным в ТК Москва(Люблино), ТК Садовод, ТК Южные Ворота</h2>\r\nВы можете забрать товар в одном из наших магазинов. Список торговых точек, на которые мы можем отправить Ваш заказ появится у вас в корзине. Когда заказ поступит в указанный магазин, вам придёт уведомление. Вы просто идёте в этот магазин, обращаетесь к сотруднику в кассовой зоне и называете номер заказа. Забрать покупку может ваш друг или родственник, который знает номер и имя, на кого он оформлен.\r\n\r\nАдреса магазинов:\r\n<ul>\r\n 	<li>1. г. Минск, ТЦ Зеркало, ул. В. Хоружей 6б, пав. 4Б</li>\r\n 	<li>2. г. Минск, ТРЦ Арена-Сити, пр-т Победителей 84</li>\r\n</ul>\r\nВы можете выбрать один из нескольких вариантов <span style=\"color: #e64547;\">ОПЛАТЫ</span>:\r\n<h3>Оплата наличными</h3>\r\nПри выборе варианта оплаты наличными, вы дожидаетесь приезда курьера и передаёте ему сумму за товар в рублях. Курьер предоставляет товар, который можно осмотреть на предмет повреждений, соответствие указанным условиям. Покупатель подписывает товаросопроводительные документы, вносит денежные средства и получает чек.\r\n\r\nТакже оплата наличными доступна при самовывозе из магазина, оплаты по почте.\r\n<h3>На банковскую карту Сбербанка, Альфа-Банка.</h3>\r\nБезналичным расчётом можно воспользоваться при курьерской доставке по РБ, самовывоза из магазина, оплате в почтовом отделении или онлайн.\r\n<h3>Безналичный перевод на счет компании. Только для ИП и ЮЛ.</h3>\r\nОплату Вы можете произвести в любом банке: интернет-банкинге, мобильном банкинге, инфокиоске, банкомате, кассе и т.д.\r\nСовершить оплату можно с использованием наличных денежных средств, любых электронных денег, банковских платежных карточек.','Доставка и оплата','','publish','closed','closed','','dostavka-i-oplata','','','2020-05-09 00:10:54','2020-05-08 21:10:54','',0,'http://remby.loc/?page_id=31',0,'page','',0),(32,1,'2020-05-04 16:23:13','2020-05-04 13:23:13','','Доставка и оплата','','inherit','closed','closed','','31-revision-v1','','','2020-05-04 16:23:13','2020-05-04 13:23:13','',31,'http://remby.loc/2020/05/04/31-revision-v1/',0,'revision','',0),(33,1,'2020-05-04 16:23:58','2020-05-04 13:23:58','','Cтатьи','','publish','closed','closed','','stati','','','2020-05-04 16:47:37','2020-05-04 13:47:37','',0,'http://remby.loc/?page_id=33',0,'page','',0),(34,1,'2020-05-04 16:23:58','2020-05-04 13:23:58','','Cтатьи','','inherit','closed','closed','','33-revision-v1','','','2020-05-04 16:23:58','2020-05-04 13:23:58','',33,'http://remby.loc/2020/05/04/33-revision-v1/',0,'revision','',0),(35,1,'2020-05-04 16:24:31','2020-05-04 13:24:31','','Контакты','','publish','closed','closed','','contacts','','','2020-05-07 21:11:15','2020-05-07 18:11:15','',0,'http://remby.loc/?page_id=35',0,'page','',0),(36,1,'2020-05-04 16:24:31','2020-05-04 13:24:31','','Контакты','','inherit','closed','closed','','35-revision-v1','','','2020-05-04 16:24:31','2020-05-04 13:24:31','',35,'http://remby.loc/2020/05/04/35-revision-v1/',0,'revision','',0),(37,1,'2020-05-04 16:38:49','2020-05-04 13:38:49','<h1>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</h1>\r\nPellentesque fermentum ex leo, vel venenatis augue pulvinar ut. Morbi mattis ipsum sit amet enim accumsan tincidunt. Duis eleifend felis nec mi interdum sodales. Donec sed tempus augue. Maecenas eu lobortis tortor. Proin id tempus augue, volutpat vestibulum u