ии товара Вы осматриваете товар на целостность и отсутствие заводского брака. После Вы оплачиваете покупку курьеру.\n\nДоставка курьером по г. Минск бесплатная - доставляем в день заказа либо на следующий.\nПо РБ 10 BYN - срок доставки 1-2 дня в зависимости от региона.\n<h2>Бесплатная доставка к автобусным стоянкам, расположенным в ТК Москва(Люблино), ТК Садовод, ТК Южные Ворота</h2>\nВы можете забрать товар в одном из наших магазинов. Список торговых точек, на которые мы можем отправить Ваш заказ появится у вас в корзине. Когда заказ поступит в указанный магазин, вам придёт уведомление. Вы просто идёте в этот магазин, обращаетесь к сотруднику в кассовой зоне и называете номер заказа. Забрать покупку может ваш друг или родственник, который знает номер и имя, на кого он оформлен.\n\nАдреса магазинов:\n<ul>\n 	<li>1. г. Минск, ТЦ Зеркало, ул. В. Хоружей 6б, пав. 4Б</li>\n 	<li>2. г. Минск, ТРЦ Арена-Сити, пр-т Победителей 84</li>\n</ul>\nВы можете выбрать один из нескольких вариантов <span style=\"color: #e64547;\">ОПЛАТЫ</span>:\n<h3>Оплата наличными</h3>\nПри выборе варианта оплаты наличными, вы дожидаетесь приезда курьера и передаёте ему сумму за товар в рублях. Курьер предоставляет товар, который можно осмотреть на предмет повреждений, соответствие указанным условиям. Покупатель подписывает товаросопроводительные документы, вносит денежные средства и получает чек.\n\nТакже оплата наличными доступна при самовывозе из магазина, оплаты по почте.\n\nНа банковскую карту Сбербанка, Альфа-Банка.\n\nБезналичным расчётом можно воспользоваться при курьерской доставке по РБ, самовывоза из магазина, оплате в почтовом отделении или онлайн.\n\nБезналичный перевод на счет компании. Только для ИП и ЮЛ.\n\nОплату Вы можете произвести в любом банке: интернет-банкинге, мобильном банкинге, инфокиоске, банкомате, кассе и т.д.\nСовершить оплату можно с использованием наличных денежных средств, любых электронных денег, банковских платежных карточек.','Доставка и оплата','','inherit','cl