INSERT INTO `wp_wc_admin_notes` VALUES (1,'wc-admin-welcome-note','info','en_US','Новые возможности','Добро пожаловать в новую среду WooCommerce! В этом новом выпуске вы сможете на специальной консоли увидеть, как работает ваш магазин, управлять важными аспектами вашего бизнеса (такими как управление заказами, запасами, отзывами) из любой точки интерфейса, разобраться в данных, поступающих из вашего магазина, с помощью совершенно нового раздела аналитики и многое другое!','info','{}','unactioned','woocommerce-admin','2020-05-04 12:49:48',NULL,0),(2,'wc-admin-store-notice-setting-moved','info','en_US','Ищете настройки \"Уведомление магазина\"?','Это можно найти в конфигураторе.','info','{}','unactioned','woocommerce-admin','2020-05-04 12:49:48',NULL,0),(3,'wc-admin-wc-helper-connection','info','en_US','Подключиться к WooCommerce.com','Подключайтесь, чтобы получать важные уведомления о продукте и обновления.','info','{}','unactioned','woocommerce-admin','2020-05-04 12:49:48',NULL,0),(4,'wc-admin-onboarding-profiler-reminder','update','en_US','Добро пожаловать в WooCommerce! Настройте свой магазин и начните продавать','Мы поможем вам пройти самые важные этапы, чтобы ваш магазин заработал.','info','{}','actioned','woocommerce-admin','2020-05-04 09:49:59',NULL,0),(5,'wc-admin-mobile-app','info','en_US','Установите мобильное приложение Woo','Установите мобильное приложение WooCommerce для управления заказами, получения уведомлений о продажах и просмотра ключевых показателей — где бы вы ни находились.','phone','{}','unactioned','woocommerce-admin','2020-05-08 11:11:08',NULL,0),(6,'wc-admin-onboarding-email-marketing','info','en_US','Советы, обновления продуктов и новые идеи','Мы работаем для вас — получайте советы, обновления продуктов и вдохновение прямо в ваш почтовый ящик.','mail','{}','unactioned','woocommerce-admin','2020-05-08 11:11:08',NULL,0),(7,'wc-admin-store-notice-giving-feedback','info','en_US','Просмотрите свой результат','Если вам нравится WooCommerce Admin, пожалуйста, поставьте нам оценку 5 звезд. Заранее благодарим!','info','{}','unactioned','woocommerce-admin','2020-05-09 12:17:29',NULL,0),(8,'wc-admin-facebook-extension','info','en_US','Маркетинг на Facebook','Развивайте свой бизнес, ориентируясь на нужных людей и стимулируя продажи с помощью Facebook. Вы можете установить это бесплатное расширение сейчас.','thumbs-up','{}','actioned','woocommerce-admin','2020-05-09 12:17:29',NULL,0),(9,'wc-admin-orders-milestone','info','en_US','Первый заказ','Поздравляем с получением первого заказа от клиента! Узнайте, как управлять своими заказами.','trophy','{}','unactioned','woocommerce-admin','2020-05-09 22:49:49',NULL,0),(10,'wc-admin-new-sales-record','info','en_US','Новый рекорд продаж!','Ого, May 11th был вашим рекордным днем по продажам! Чистый объем продаж30  076,00₽ побил предыдущий рекорд 29  570,00₽ установленный на May 10th.','trophy','{\"old_record_date\":\"2020-05-10\",\"old_record_amt\":29570,\"new_record_date\":\"2020-05-11\",\"new_record_amt\":30076}','unactioned','woocommerce-admin','2020-05-12 09:37:23',NULL,0);
